E_D("replace into `go_shoplist` values('67','14','6','10','苹果（Apple）iMac ME086CH/A 21.5英寸一体电脑','','佳能（Canon） EOS 70D 单反套机 （EF-S 18-135mm f/3.5-5.6 IS STM镜头）佳能（Canon） EOS 70D 单反套机 （EF-S 18-135mm f/3.5','佳能,单反,数码相机','','2.00','1.00','2','2','0','0','41','100','shopimg/20150824/38400556430736.png','a:3:{i:0;s:35:\"shopimg/20150824/58474134430744.png\";i:1;s:35:\"shopimg/20150824/39462182430748.png\";i:2;s:35:\"shopimg/20150824/52861321430752.png\";}','<p><br/></p><p><br/></p><p style=\"font-size:60px; line-height:65px; padding:30px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:2px;\">	iPhone6</p><p><br/></p><p style=\"font-size:38px; line-height:38px; padding:20px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:5px; color:#333;\">	比更大还更大</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:16px; line-height:28px; padding:20px 20px 0px 20px; margin:0px; text-align:center;\">	iPhone 6 之大，不只是简简单单地放大，而是方方面面都大有提升。<br/>	它尺寸更大，却纤薄得不可思议；性能更强，却效能非凡。光滑圆润的金属机身，<br/>	与全新 Retina HD 高清显示屏精准契合，浑然一体。而软硬件间的搭配，更是默契得宛如天作之合。<br/>	无论以何种尺度衡量，这一切，都让 iPhone 新一代的至大之作，成为至为出众之作。</p><p><br/></p><p style=\"padding:10px 0px; margin:0px; text-align:center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140910143950500.jpg\"/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:34px; line-height:48px; padding:220px 0px 0px 60px; margin:0px; letter-spacing:2px; color:#333;\">	是 iPhone 的至大之作，<br/>	也是至薄之作。</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 60px; margin:0px;\">	要开发一个尺寸更大，更先进的 iPhone\n显示屏，就要在设计上大大突破极限。从金属与玻璃的精密结合，到光滑圆润的流线机身，每处细节都是深思熟虑的结晶，旨在带给你更为出众的使用体验。因此，\n虽然 iPhone 6 的显示屏变大了，但却让人感觉大得恰到好处。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:25px; line-height:48px; padding:240px 0px 0px 80px; margin:0px; letter-spacing:2px; color:#333;\"><span style=\"font-size:65px; line-height:70px;\">6.9</span> 毫米</p><p><br/></p><p style=\"font-size:15px; line-height:22px; padding:0px 0px 0px 90px; margin:0px; letter-spacing:2px; color:#333;\">	iPHONE 6</p><p><br/></p><p style=\"font-size:25px; line-height:48px; padding:25px 0px 0px 80px; margin:0px; letter-spacing:1px; color:#333;\"><span style=\"font-size:65px; line-height:70px;\">7.1</span> 毫米</p><p><br/></p><p style=\"font-size:15px; line-height:22px; padding:0px 0px 0px 90px; margin:0px; letter-spacing:1px; color:#333;\">	iPHONE 6 PLUS</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p style=\"padding:20px 0px 0px 0px; margin:0px; text-align:center;\"><img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140910144019403.jpg\"/></p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:120px 0px 0px 20px; margin:0px; letter-spacing:2px; color:#333;\">	不仅更大<br/>	更大放异彩</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 20px; margin:0px; width:390px;\">	把显示屏做大并非难事，但打造一块将绚丽色彩、更高对比度、更广阔浏览视角集于一身的大尺寸 Multi-Touch 显示屏，则完全是另一个境界的事。 而这，也正是我们在全新 Retina HD 高清显示屏上所做到的。</p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:20px 0px 0px 20px; margin:0px; letter-spacing:2px; color:#333;\">	1334×750</p><p><br/></p><p style=\"font-size:16px; line-height:28px; padding:0px 10px 0px 20px; margin:0px; width:390px;\">	iPHONE 6分辨率</p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:10px 0px 0px 20px; margin:0px; letter-spacing:2px; color:#333;\">	1920×1080</p><p><br/></p><p style=\"font-size:16px; line-height:28px; padding:0px 10px 0px 20px; margin:0px; width:390px;\">	iPHONE 6 PLUS 分辨率</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:265px 0px 0px 20px; margin:0px; letter-spacing:2px; color:#333;\">	大有动力,大有能效。</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 20px; margin:0px; width:390px;\">	新一代 A8 芯片基于 64 位台式电脑级架构，可提供更为强劲的动力，即使是驱动这样一个更大的显示屏也游刃有余。M8\n运动协处理器则能通过先进的传感器和全新的气压计来高效地收集数据。再加上提升的电池使用时间，iPhone 6 能让你拥有更多时间，去做到更多。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:38px; line-height:55px; padding:320px 0px 0px 0px; margin:0px; letter-spacing:2px; color:#333; text-align:center;\">	一个相机，改变了摄影，<br/>	又将颠覆摄像。</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 20px; margin:0px; text-align:center;\">	越来越多的人喜欢用 iPhone 来随时随地拍摄照片。而现在，配备全新传感器的 iSight 摄像头不仅支持 Focus\nPixels，还新增更多视频功能。比如你可以拍摄 60 fps 的 1080p HD 高清视频，240 fps\n的慢动作视频，还可以选择延时摄影模式。因此，你将有更多理由用视频去捕捉更多的美好时刻，就像拍照一样简单自然。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:12px; line-height:22px; padding:20px 10px 0px 160px; margin:0px;\">	全新的传感器支持 Focus Pixels，<br/>	可实现更快的自动对焦。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:100px 0px 0px 430px; margin:0px; letter-spacing:2px; color:#333;\">	更快无线连接，<br/>	连接更宽广。</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 430px; margin:0px; width:350px;\">	有了更快的 4G LTE 网络下载速度*，以及更多 LTE 频段支持，iPhone 6 能让你在更广阔的天地，更自由地遨游。而当你接入无线网络时，还能体验到快达 3 倍的无线网络速度。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:140px 0px 0px 20px; margin:0px; letter-spacing:2px; color:#333;\">	安全，全凭指尖。</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 20px; margin:0px; width:360px;\">	突破性的 Touch ID 技术让你安全访问自己的 iPhone 有了独一无二的密码：你的指纹。并且，这一方式还能用来确认你在 iBooks 和 App Store 中的下载或购买，从而无需再输入密码。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:42px; line-height:55px; padding:140px 0px 0px 430px; margin:0px; letter-spacing:2px; color:#333;\">	有史以来极其重大的 iOS 版本</p><p><br/></p><p style=\"font-size:15px; line-height:28px; padding:20px 10px 0px 430px; margin:0px; width:350px;\">	iOS 8 是了不起的先进移动操作系统，它以令人惊叹的全新功能和特性，将大显示屏的优势尽致呈现。对 iPhone 6 来说，这不仅仅是一次软硬件间宛如天成的绝佳匹配，更是创造了一种将每个细微之处，都变得大为出众的绝佳体验。</p><p><br/></p><p><br/></p><p><br/></p><p style=\"font-size:18px; line-height:25px; padding:20px 0 5px 5px; margin:0px;\">	重要说明：</p><p><br/></p><p style=\"font-size:14px; line-height:22px; padding:0 0 5px 5px;